import { Injectable } from '@angular/core';

@Injectable({
  providedIn: 'root'
})
export class AuthService {

  user: IUser | null = { 
    username: 'John',
    email: 'test123@gmail.com',
    tel: '00359 8885632'
   } as any;

  get isLoggedIn() {
    return this.user !== null;
  }

  constructor() { }
}
